         border-radius: 4px;
         font-size: 48px;
         }
         /* Creates a small triangle extender for the tooltip */
         .d3-tip:after {
         box-sizing: border-box;
         display: inline;
         font-size: 10px;
         width: 100%;
         line-height: 1;
         color: rgba(0, 0, 0, 0.8);
         content: "\25BC";
         position: absolute;
         text-align: center;

         /* Style northward tooltips specifically */

         var margin = {top: (0.02*height), right: (0.02*width), bottom: (0.02*height), left: (0.02*width)};
         
         // dimensions and margins
         var svg = d3.select("#my_chart").append("svg")
         .attr("width", width)
            .attr("height", height);
         
         // create a clipping region 
         svg.append("defs").append("clipPath")
          .attr("id", "clip")
         .append("rect")
          .attr("width", width)
          .attr("height", height);
         
         // read data		
         data_ = read_data();
         data = data_[0];
         x_min = data_[1];
         x_max = data_[2];
         y_min = data_[3];
         y_max = data_[4];
         
         // create scale objects
         var xScale = d3.scaleLinear()
         .domain([x_min, x_max])
         .range([0, width]);
         var yScale = d3.scaleLinear()
         .domain([y_min, y_max])
         .range([height, 0]);
         
         // create axis objects
         var xAxis = d3.axisBottom(xScale)
         .ticks(20, "s");
         var yAxis = d3.axisLeft(yScale)
         .ticks(20, "s");
         
         // Draw Axis
         var gX = svg.append('g')
         .attr('transform', 'translate(' + margin.left + ',' + (margin.top) + ')')
         .call(xAxis);
         
         var gY = svg.append('g')
         .attr('transform', 'translate(' + margin.left + ',' + margin.top+ ')')
         .call(yAxis);
         
         // Pan and zoom
         var zoom = d3.zoom()
          .scaleExtent([0.01, 500])
          .extent([[0, 0], [width, height]])
          .on("zoom", zoomed);
         
          var rect = d3.select("svg")
          .append("rect")
          .attr("width", width)
          .attr("height", height)
          .style("fill", "none")
          .style("pointer-events", "all")
          .attr('transform', 'translate(' + margin.left + ',' + margin.top + ')')
          .call(zoom);
         
         // Draw Datapoints
         var points_g = svg.append("g")
         .classed("dot", true)
         .attr('transform', 'translate(' + margin.left + ',' + margin.top + ')')
         .attr("clip-path", "url(#clip)")
         .classed("points_g", true);
         
           // Tooltip
         var tool_tip = d3.tip()
         .attr("class", "d3-tip")
         .offset([-8, 0])
         .html(function(d) { return d.msg;});
             svg.call(tool_tip);
         
         // draw data
         var points = points_g.selectAll("circle").data(data);
         points = points.enter().append("circle")
         .attr('cx', function(d) {return xScale(d.x)})
         .attr('cy', function(d) {return yScale(d.y)})
         .attr('r',  function(d) {return d.size})
          .on('mouseover', tool_tip.show)
          .on('mouseout', tool_tip.hide)
                  .style("fill", function(d) {return colorScale(d.label); });
         
         function zoomed() {
         // create new scale ojects based on event
          var new_xScale = d3.event.transform.rescaleX(xScale);
          var new_yScale = d3.event.transform.rescaleY(yScale);
         // update axes
          gX.call(xAxis.scale(new_xScale));
          gY.call(yAxis.scale(new_yScale));
          points.data(data)
         .attr('cx', function(d) {return new_xScale(d.x)})
         .attr('cy', function(d) {return new_yScale(d.y)});
         }
